import { ArrowCircleDownIcon, ArrowCircleUpIcon } from "@heroicons/react/outline";

function Voting()
{
    const buttonClassName =  "mt-2 mx-1 h-6 w-6 bg-theme_dark text-theme_dark-highlight rounded-full";
    return(
    <div className = {'inline flex ' }>
       
        <ArrowCircleUpIcon className ={buttonClassName}/>
        <span className = {'my-1 py-2 text-xs font-bold'}>0</span>
        <ArrowCircleDownIcon className = {buttonClassName}/>
    </div>
    );
}

export default Voting;
